import React, { Component } from 'react';
import { Login, Button } from '@../../../../reactify/build';
import {
  simpleCode,
} from './code-refrence';
import './login.scss';
import DemoCard from '../../components/demo-card';

class ModalDemo extends Component {
    state = {
      fields: {
        username: {
          value: 'username',
          isError: false,
          errorText: 'username error',
          isLoading: false,
          disabled: false,
        },
        password: {
          value: 'password',
          isError: false,
          errorText: 'password error',
          isLoading: false,
          disabled: false,
        },
        submit: {
          isLoading: false,
          disabled: false,
        },
        error: {
          visible: false,
          text: 'main error',
        },
      },
      injectConfig: false,
    };

    render() {
      return (
        <div>
          <DemoCard
            title="Simple Use"
            uniqueIdentifier="simpleUse"
            sourceCode={simpleCode}
          >
            <Login config={this.state.injectConfig ? this.state.fields : undefined} />
            <Button onClick={() => this.setState({ injectConfig: true })}>Inject Config</Button>
          </DemoCard>
        </div>
      );
    }
}

export default ModalDemo;
